  false,\n\t\"url\": null,\n\t\"notes\": \"Post-cruise download of raw data from shipboard
  computer(s) as furnished by the Woods Hole Oceanographic Institution Shipboard Scientific
  Support Group and archived by the Marine Biological Laboratory Woods Hole Oceanographic
  Institution Library for the R/V Atlantis - Cruise 015 Leg 45.nnThese data are part
  of a collection of ocean observation data from Woods Hole Oceanographic Institution
  ships OCEANUS (call sign WXAQ; built 1975.00; IMO 7603617), KNORR (call sign KCEJ;
  built 1970.00; IMO 7738618), and the ATLANTIS (call sign KAQP; built 1997.03; IMO
  9105798). The data sets are the downloads of the shipboard computers after an individual
  cruise. As such, they contain basic raw and processed physical and meteorological
  data from the cruise. A data set may include XBT, CTD, and XCTD profiles, underway
  thermosalinograph and atmospheric measurements, gravity and magnetic field measurements,
  current measurements from ADCP, and still photographs from the Alvin submersible
  (Atlantis cruises only). Other data types (ROV, nutrients measured from bottle samples,
  etc.) and photographs documenting the cruise may be included.\",\n\t\"license_title\":
